import React from "react";
import { makeStyles, Typography } from "@material-ui/core";

const useStyles = makeStyles({
  container: {
    width: "100vw",
    overflowX: "hidden",
    height: 200,
    backgroundColor: "#01166C",
    paddingTop: 50,
    paddingLeft: "5%",
    paddingRight: "5%",
  },
  titleContainer: {
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    color: "white",
    fontWeight: "normal",
  },
  extraBackgroundContainer: {
    width: "100vw",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    height: 411,
    zIndex: -1,
    background:
      "transparent linear-gradient(180deg, #028D9ADE 0%, #8F749CE6 100%) 0% 0% no-repeat padding-box",
  },
});

const Intro: React.FC<{}> = () => {
  const classes = useStyles();

  return (
    <div className={classes.container}>
      <div className={classes.extraBackgroundContainer}>
        <Typography variant="h6">Title</Typography>
        <Typography variant="subtitle1">Sub title</Typography>
      </div>
      <div className={classes.titleContainer}></div>
    </div>
  );
};

export default Intro;
